import Navbar from '../components/Navbar';
import fecomercio from '../assets/fecomercio.png';
import Footer from '../components/Footer';

export default function About() {
  return (
    <>
      <Navbar />
      <div class="about">
        <div class="section">
          <h3>Sobre nós</h3>
          <p>De onde somos e o que fazemos</p>
        </div>
        <div>
          <p>"Fortaleza, cidade litorânea onde o verão dura o ano inteiro, é a cidade base do estúdio."</p>
        </div>
        <img src={fecomercio} />
      </div>
      <Footer />
    </>
  )
}
